@Component({
  selector: 'app-slide-add',
  templateUrl: './slide-add.component.html',
  styleUrls: ['./slide-add.component.scss']
})
export class SlideAddComponent {
  slide = {
    photos: null,
  };
}
<p>slide-add works!</p>
